            background-color: var(--color-white);
            opacity: 0;
        }

        &__scrollbar-cover {
            transition: all .5s;
            display: inline-block;
            position: absolute;
            right: 0;
            width: 15%;
            height:100%;
            background-color: rgba(var(--color-white), 1);
            pointer-events: none;
        }
    }

    &__icon {
        width: 26px;
        height: 26px;

        &:hover {
            background-color: $color-gray-light-4;
            border-radius: 50%;
        }
    }
